import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import myImg from '../../../images/banner-img-2.jpg';
import './About.css';

const About = () => {
    return (
        <div className="about-section">
            <Container>
                <Row>
                    <Col md={6}>
                        <div className="about-img-container">
                            <img className="img-fluid  about-img" src={myImg} alt="Atikul Jaman's Image" />
                            <div className="about-img-border-style">

                            </div>
                        </div>
                    </Col>
                    <Col md={6}>
                        <div className="about-desc">
                            <h3>About Me</h3>
                            <p className="mt-4">
                                Hi, I'm Atikul Jaman a junior web developer based in Bangladesh. I'm a 22-year-old guy. I'm always excited to learn and explore new technology. I do 6 to 8 hours of coding daily. My dream is to become a full-stack web developer full of skills. Already I have skills as a "junior frontend developer" and also have basic knowledge of backend development.
                            </p>
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default About;
